import React from "react";
import {BsPlus} from "reac"

function Pool() {
  return (
    <>
      <div className="w-1/2 m-auto my-10 border border-red-400">
        <div className="flex justify-between p-4 items-center">
          <p>Pools</p>{" "}
          <button className="bg-red-500 px-6 py-2 text-lg hover:bg-red-600 rounded-md text-[#FFFFFF] font-medium">
           <BsPlus/> New Position
          </button>
        </div>
      </div>
    </>
  );
}

export default Pool;
